public void assertTestSubscriber() {
    Flowable<Integer> oi = Flowable.fromIterable(Arrays.asList(1, 2));
    TestSubscriber<Integer> ts = new TestSubscriber<Integer>();
    oi.subscribe(ts);

    ts.assertValues(1, 2);
    ts.assertValueCount(2);
    ts.assertComplete();
    ts.assertNoErrors();
}

